import React from 'react';
import { Stage, Layer } from 'react-konva';
import './App.css';
import ColoredRect from './ColoredRect';

function App() {
  return <Stage width={window.innerWidth} height={window.innerHeight}>
    <Layer>
      <ColoredRect />
    </Layer>
  </Stage>;
}

export default App;
